import React from "react";
import "./cart.scss";
const CartItem = ({ img, name, count, price }) => {
  return (
    <div className="cart__oder">
      <table className="cart__table">
        <tr>
          <td colSpan={2}>замовлення</td>
          <td>кількість</td>
          <td>ціна</td>
        </tr>
      </table>
      <table className="cart__date">
        <tr>
          <td className="cart__date-img">
            <img className="date-img" src={img} alt="" />
          </td>
          <td className="cart__date-name">{name}</td>
          <td className="cart__date-amount">{count}</td>
          <td className="cart__date-price">{price}</td>
        </tr>
      </table>
    </div>
  );
};

export default CartItem;
